import ItemsDate from './ItemsDate';

function Items(props)
{
    return (
    <div>
      <div className="main-header">
        <ItemsDate date = {props.d[0].date}></ItemsDate>
        <span>{props.d[0].title}</span>
        <span>{props.d[0].cost}</span>
      </div>
      <div className="main-header">
        <ItemsDate date = {props.d[1].date}></ItemsDate>
        <span>{props.d[1].title}</span>
        <span>{props.d[1].cost}</span>
      </div>    
      <div className="main-header">
        <ItemsDate date = {props.d[2].date}></ItemsDate>
        <span>{props.d[2].title}</span>
        <span>{props.d[2].cost}</span>
     </div> 
    </div>
    );
}
export default Items;
